import './App.css';
import Register from './components/register';
import Login from './components/register';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Login/>} />
          <Route path="/login" element={<Login/>}/>
          <Route path="/registration" element={<Register/>}/>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
